import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { ChakraProvider } from '@chakra-ui/core';
import { Box, Divider, Text, Image } from '@chakra-ui/core';

function Top () {
  return (
    <div className="Top">
      <h1>Nothing Starts Finished</h1>
      <p>This website is dedicated to showing the unfinished beginnings of what
        looks finished today.</p>
      <p>Today's giants of industry, technology, science and business... well,
        everything really... Started<br /> off as yesterday's awkward teenagers,
         hacks and experiments. <br /><br />Proof below.
      </p>
    </div>
  );
}

function Inter () {
  return (
    <Box mt="10vh" w='100%'>
    { /* images root index is to 'public' directory, adjacent to index.html */ }
      <img src="/intercom-transparent-logo.svg" alt="Intercom black logo"/>
      <Text mb="20px">Intercom is a 'conversational relationship platform,' a suite of tools dedicated
      to helping companies help their customers. Founded in 2011, Intercom today is worth
      $1.6 billion and employs over 600 people. In the beginning though, Intercom was just
      a tool to broadcast messages to users of web-apps instead of emailing them one by one.
      </Text>
      <Box>
        <Text> Sample text...
        </Text>
        <Image src="/intercom-product.png"/>
      </Box>
    </Box>
  );
}

function Website () {
  return (
    <ChakraProvider>
      <div className="mainBody">
        <Top />
        <Divider my="10vh"/>
        <Inter />
      </div>
    </ChakraProvider>
  );
}

ReactDOM.render(
  <React.StrictMode>
    <Website />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
